import styled from "@emotion/styled";
import tabtheme from "../../GlobalStyles/Theme";

export const TabStyleCard = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: space-around;
  background-color: ${tabtheme.colors["first100"]};
  min-height: 150px;
  border-radius: 10px;
  color: white;
`;
